         // Color used in border\n$selectric-secondary-color: #BBB !default;                                              // Color used in button\n$selectric-text-color:      #444 !default;                                              // Color used in label\n$selectric-bg-color:        #F8F8F8 !default;                                           // Background color\n$selectric-height:          40px !default;                                              // Outer height\n$selectric-spacing:         10px !default;                                              // Label left padding\n$selectric-border-width:    1px !default;                                               // Outer border width\n$selectric-inner-height:    $selectric-height - ($selectric-border-width * 2) !default; // Inner height\n\n.selectric-wrapper {\n  position: relative;\n  cursor: pointer;\n}\n\n.selectric-responsive {\n  width: 100%;\n}\n\n\n// select\n.selectric {\n  @include transition;\n  @include border-radius;\n  border: $input-border-width solid $input-border-color;\n  background-color: transparent;\n  position: relative;\n\n  .label {\n    display: block;\n    white-space: nowrap;\n    overflow: hidden;\n    margin: 0;\n    text-overflow: ellipsis;\n    padding: $input-padding-y $input-padding-x;\n    line-height: $input-line-height;\n    color: $input-color;\n    user-select: none;\n  }\n\n  .button {\n    display: block;\n    position: absolute;\n    right: 0;\n    top: 0;\n    bottom: 0;\n    width: ($input-padding-y * 2 + $input-line-height);\n    text-align: center;\n    font: 0/0 a;\n    *font: 20px/#{$selectric-inner-height} Lucida Sans Unicode, Arial Unicode MS, Arial;\n\n    &:after {\n      content: \" \";\n      position: absolute;\n      top: 0;\n      right: 0;\n      bottom: 0;\n      left: 0;\n      margin: auto;\n      width: 0;\n      height: 0;\n      border: 4px solid transparent;\n      border-top-color: $selectric-secondary-color;\n      border-bottom: none;\n    }\n  }\n}\n\n\n\n// small\n.selectric-form-control-sm {\n  .selectric {\n    .label {\n      font-size: $font-size-sm;\n      line-height: $btn-line-height-sm;\n      padding: $btn-padding-y-sm;\n    }\n  }\n\n  .selectric-items {\n    li {\n      padding: $input-padding-y-sm $input-padding-x-sm;\n      font-size: $font-size-sm;\n\n      &:before {\n        margin-top: -.25rem;\n        width: .5rem;\n        height: .5rem;\n      }\n    }\n  }\n}\n\n\n// large\n.selectric-form-control-lg {\n  .selectric {\n    .label {\n      font-size: $font-size-lg;\n      line-height: $btn-line-height-lg;\n      padding: $btn-padding-y-lg;\n    }\n  }\n\n  .selectric-items {\n    li {\n      padding: $input-padding-y-lg $input-padding-x-lg;\n      font-size: $font-size-lg;\n    }\n  }\n}\n\n.selectric-open {\n  z-index: 9999;\n\n  .selectric {\n    border-color: transparent;\n  }\n\n  .selectric-items {\n    display: block;\n  }\n}\n\n.selectric-disabled {\n  filter: alpha(opacity=50);\n  opacity: 0.5;\n  cursor: default;\n  user-select: none;\n}\n\n.selectric-hide-select {\n  position: relative;\n  overflow: hidden;\n  width: 0;\n  height: 0;\n\n  select {\n    position: absolute;\n    left: -100%;\n    display: none;\n  }\n}\n\n.selectric-input {\n  position: absolute !important;\n  top: 0 !important;\n  left: 0 !important;\n  overflow: hidden !important;\n  clip: rect(0, 0, 0, 0) !important;\n  margin: 0 !important;\n  padding: 0 !important;\n  width: 1px !important;\n  height: 1px !important;\n  outline: none !important;\n  border: none !important;\n  *font: 0/0 a !important;\n  background: none !important;\n}\n\n.selectric-temp-show {\n  position: absolute !important;\n  visibility: hidden !important;\n  display: block !important;\n}\n\n/* Items box */\n.selectric-items {\n  @extend %boxed;\n  @extend %floating;\n  @include border-radius;\n  display: none;\n  position: absolute;\n  top: $border-width;\n  left: $border-width;\n  right: $border-width;\n  border: 0;\n  z-index: 1;\n\n  